import { useNavigate } from "react-router-dom";

const Home = () => {
	const navigate = useNavigate();

	const navigateHandler = () => {
		navigate("./Products.jsx");
	};

	return (
		<div>
			<h1>Home Page </h1>
		</div>
	);
};

export default Home;
